import React from "react";
import {FacebookFilled,InstagramOutlined } from '@ant-design/icons';
import FontAwesome from 'react-fontawesome'
const SocialFollow = () =>{
    return(
        <>
        <div className="contact-us-flag">
			<a href="https://acclaimedhw.com/contact-us/" class="desktop" title="contact us">
				contact us
			</a>
			<a href="https://www.facebook.com/acclaimedhomewarranty/" target="_blank" title="">
				<i class="achi facebook"></i>
			</a>
			<a href="https://www.instagram.com/acclaimedhwslc/?hl=en" target="_blank" title="">
				<i class="achi instagram"></i>
        <FontAwesome
        className="super-crazy-colors"
        name="rocket"
        cssModule={faStyles}
        size="2x"
        spin
        style={{ textShadow: '0 1px 0 rgba(0, 0, 0, 0.1)' }}
      />
			</a>
		</div>
        </>
    ) 
};
export default SocialFollow;
